import React from "react";
import Markdown from "markdown-to-jsx";
import { Box, BoxItem, Button, Card, CardContent, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { ArrowBack } from '@material-ui/icons';
import profilbild from "./images/profilbild_test_2.png"

const Hem = () => {

    const useStyles = makeStyles({

          mainDiv: {
            margin: "0px",
            padding: "0px",
          },
          imgProfile: {
            maxWidth: "250px",
            maxHeight: "250px",
            ['@media (max-width:700px)']: {
              maxWidth: "200px",
              maxHeight: "200px",
              marginLeft: "auto",
              marginRight: "auto",
            }
          },
          boxThing: {
            height: "500px",
            padding: "0px",
            border: "1px solid black",
            textAlign: "left",
            display: "flex",
            flexDirection: "row",
            justifyContent: 'center',
            margin: "0px",
            ['@media (max-width:700px)']: {
              display: "inline",
              padding: "0px",
            }
          },
          textBox: {
            //border: "1px solid black",
            paddingLeft: "0px",
            paddingRight: "0px",
            margin: "0px",
            //border:"1px solid black"
            ['@media (max-width:700px)']: {
              marginTop: "10px",
            }
            
          },
          textWelcome: {
            //border: "1px solid black",
            //display: 'none',
            marginTop: "25px",
            ['@media (max-width:700px)']: {
              padding: "0px"
            }
          }
  
      })

      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
  
                        <Typography variant="h4" className = {classes.textWelcome}>
                          Välkommen!
                        </Typography>
                     {/*    <Box className ={classes.boxThing}>
                        <Box className ={classes.imgProfile}
                        component="img"
                        alt="Picture did not load"
                        src={profilbild}
                        />
